import React from 'react';
import { connect } from 'redux-bundler-react';
class Map extends React.Component {
    componentDidMount(){
        const { doMapInitialize } = this.props;
        doMapInitialize(this.el)
    }
    render(){
        return (
            <div ref={(el) => this.el = el}>
            </div>
        )
    }
}

export default connect(
    'doMapInitialize',
    Map
);
